using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace CollegeBasketball
{
    class Program
    {
        static void Main(string[] args)
        {
            var questions = new List<Question>();
            var answers = new List<Answer>();
            var questionsToAnswer = new List<Question>();
            var answersToAnswer = new List<Answer>();

            var input = Console.ReadLine();
            while (input != "end")
            {
                var question = new Question();
                var answer = new Answer();
                var questionToAnswer = new List<Question>();
                var answerToAnswer = new List<Answer>();

                var inputLine = input.Split();
                question.Question = inputLine[0];
                answer.Answer = inputLine[1];
                questionToAnswer.Add(question);
                answerToAnswer.Add(answer);

                input = Console.ReadLine();
            }

            var questionsToAnswer = questionsToAnswer.OrderBy(q => q.Question).ToList();
            var answersToAnswer = answersToAnswer.OrderBy(a => a.Answer).ToList();

            var correctAnswers = questionsToAnswer.Select(q => q.Question).Distinct().ToList();
            var correctAnswersToAnswer = answersToAnswer.Select(a => a.Answer).Distinct().ToList();

            var correctAnswersCount = correctAnswers.Count;
            var correctAnswersToAnswerCount = correctAnswersToAnswer.Count;

            if (correctAnswersCount == correctAnswersToAnswerCount)
            {
                Console.WriteLine("Congratulations!");
            }
            else
            {
                Console.WriteLine("Sorry, you failed!");
            }

            foreach (var question in questionsToAnswer)
            {
                Console.WriteLine(question.Question);
                foreach (var answer in answersToAnswer)
                {
                    Console.WriteLine(answer.Answer);
                }
            }
        }
    }

